package whut.inis.show.po;

public class LunWenInfo {
	private int id;
	private String timu;
	private String leibie;
	private String author;
	private String publishtime;
	private String uploadtime;
	private String beizhu;
	private String filename;
	private String flieurl;
	private String gongkai;
	
	public LunWenInfo() {
		super();
		// TODO Auto-generated constructor stub
	}

	public LunWenInfo(int id, String timu, String leibie, String author,
			String publishtime, String uploadtime, String beizhu,
			String filename, String flieurl, String gongkai) {
		super();
		this.id = id;
		this.timu = timu;
		this.leibie = leibie;
		this.author = author;
		this.publishtime = publishtime;
		this.uploadtime = uploadtime;
		this.beizhu = beizhu;
		this.filename = filename;
		this.flieurl = flieurl;
		this.gongkai = gongkai;
	}

	public int getId() {
		return id;
	}

	public void setId(int id) {
		this.id = id;
	}

	public String getTimu() {
		return timu;
	}

	public void setTimu(String timu) {
		this.timu = timu;
	}

	public String getLeibie() {
		return leibie;
	}

	public void setLeibie(String leibie) {
		this.leibie = leibie;
	}

	public String getAuthor() {
		return author;
	}

	public void setAuthor(String author) {
		this.author = author;
	}

	public String getPublishtime() {
		return publishtime;
	}

	public void setPublishtime(String publishtime) {
		this.publishtime = publishtime;
	}

	public String getUploadtime() {
		return uploadtime;
	}

	public void setUploadtime(String uploadtime) {
		this.uploadtime = uploadtime;
	}

	public String getBeizhu() {
		return beizhu;
	}

	public void setBeizhu(String beizhu) {
		this.beizhu = beizhu;
	}

	public String getFilename() {
		return filename;
	}

	public void setFilename(String filename) {
		this.filename = filename;
	}

	public String getFlieurl() {
		return flieurl;
	}

	public void setFlieurl(String flieurl) {
		this.flieurl = flieurl;
	}

	public String getGongkai() {
		return gongkai;
	}

	public void setGongkai(String gongkai) {
		this.gongkai = gongkai;
	}
	
	
	




	
	
	
}
